import Button from "./button";

function Sidebar(props) {
  return (
    <aside className="grid grid-aside">
      <section>
        {props.map((post) => {
          <Button kind="primary" text={post.title}/>
        })}
      </section>
    </aside>
  );
}

export default Sidebar;
